import React from "react";

const Header = () => {
  const getText = (text) => {
    return (
      <div>
        <h1>{text}</h1>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Debitis eius
          nobis nostrum. Atque asperiores quas nobis minus cumque hic et natus
          odio id sunt repellat sint quam harum dolores, recusandae rem eos
          eveniet consequatur, adipisci reiciendis magnam illum tempore! Minus.
        </p>
      </div>
    );
  };

  return getText("Hello sammi");
};

export default Header;
